import React from 'react'

const CoinBlock = (props) => {
    //debugger
    return (
        <div>
            <div>
                <div>{props.name}</div>
            </div>
            <div>
                <img src={props.img} />
            </div>
        </div>
    )
}

export default CoinBlock
